import classNames from 'classnames';
import React from 'react';
import '../scss/SubVideo.scss';

function SubVideo({ size, className, ...rest}) {
    return (
        <>
            <p>멋쟁이 제작자 이야기</p>
            <div className={classNames('subVideo',size, className)}{...rest}>
                {SubVideo}
            </div>
        </>
    )
}

export default SubVideo
